<!DOCTYPE html>
<html lang="zh-TW">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>ÈÄöÈóúÂØÜÁ¢º</title>
    <style>
        body, html { margin:0; padding:0; height:100%; width:100%; background:#1a1a1a; overflow: hidden; -webkit-tap-highlight-color: transparent; }
        #vfs-iframe { width: 100%; height: 100%; border: none; display: none; }
        
        #shroud { 
            position: fixed; top: 0; left: 0; width: 100%; height: 100%; 
            display: flex; flex-direction: column; justify-content: center; align-items: center; 
            background: #f4f1de; transition: opacity 1s; z-index: 9999; 
            overflow: hidden;
            cursor: pointer;
            touch-action: manipulation;
            user-select: none;
            -webkit-user-select: none;
        }

        #marquee {
            width: 100%;
            overflow: hidden;
            position: relative;
        }

        .marquee-content {
            display: inline-flex;
            align-items: center;
            will-change: transform;
            animation: marquee 12s linear infinite;
            font-family: "Noto Serif TC", "Songti TC", "STSong", "Microsoft JhengHei", serif;
            font-size: 3rem;
            font-weight: 300;
            white-space: nowrap;
        }

        /* È¶¨Áæ§Èô£ÂûãÔºö2 ÂåπÂú®ÂâçÔºàÂ∑¶Ôºâ„ÄÅ1 ÂåπÂú®ÂæåÔºàÂè≥Ôºâ */
        .horse-group {
            display: inline-flex;
            position: relative;
            margin-right: 40px;
            width: 160px;
            height: 120px;
            flex-shrink: 0;
        }

        .horse {
            position: absolute;
            font-size: 2.8rem;
            animation: gallop 0.6s ease-in-out infinite alternate;
        }

        /* ÂâçÊñπ 2 Âåπ */
        .horse-lead-1 { left: 0; top: 0; z-index: 2; animation-delay: 0.1s; }
        .horse-lead-2 { left: 0; bottom: 0; z-index: 2; animation-delay: 0.2s; }
        /* ÂæåÊñπ 1 Âåπ */
        .horse-back { left: 80px; top: 50%; transform: translateY(-50%); z-index: 1; animation-delay: 0.3s; }

        #text-wrapper {
            display: inline-flex;
            align-items: center;
        }

        .char {
            display: inline-block;
            opacity: 0;
            transform: translateY(15px);
            animation: charIn 0.8s ease forwards;
            margin-right: 12px;
        }

        @keyframes marquee {
            0% { transform: translateX(100vw); }
            100% { transform: translateX(-100%); }
        }

        @keyframes gallop {
            from { transform: translate(0, -5px) rotate(-3deg); }
            to { transform: translate(0, 5px) rotate(3deg); }
        }

        @keyframes charIn {
            to { opacity: 1; transform: translateY(0); }
        }
    </style>
</head>

            const colors = ['#e07a5f', '#3d405b', '#81b29a', '#f2cc8f', '#6d597a', '#748e63'];
            let _VFS = null;
            let _clicks = [];

            const text = "ÈÄöÈóúÂØÜÁ¢º";
            const textWrapper = document.getElementById('text-wrapper');
            
            function buildText() {
                textWrapper.innerHTML = '';
                text.split('').forEach((char, i) => {
                    const span = document.createElement('span');
                    span.className = 'char';
                    span.innerText = char;
                    span.style.color = colors[i % colors.length];
                    // ËÆìÊñáÂ≠óÂú®È¶¨Áæ§Á∂ìÈÅéÂæåÔºåÊúâÂ±§Ê¨°Âú∞ÊµÆÁèæ
                    span.style.animationDelay = (0.5 + i * 0.45) + 's';
                    textWrapper.appendChild(span);
                });
            }

            buildText();

            const shroud = document.getElementById('shroud');

            const handleSecretClick = () => {
                const now = Date.now();
                _clicks.push(now);
                _clicks = _clicks.filter(t => now - t < 2000);
                if (_clicks.length >= 6) {
                    _clicks = [];
                    unlock();
                }
            };

            shroud.addEventListener('click', handleSecretClick);
            shroud.addEventListener('touchend', (e) => {
                e.preventDefault(); 
                handleSecretClick();
            }, { passive: false });

            async function unlock() {
                if (_VFS) return;
                try {
                    const decrypted = await decryptData(_P, _S);
                    _VFS = JSON.parse(decrypted);
                    shroud.style.opacity = '0';
                    setTimeout(() => {
                        shroud.style.display = 'none';
                        const iframe = document.getElementById('vfs-iframe');
                        iframe.style.display = 'block';
                        render('index.html');
                    }, 1000);
                } catch(e) { console.error("Ëß£ÈéñÂ§±Êïó", e); }
            }

            async function decryptData(pkg, seed) {
                const enc = new TextEncoder();
                const dec = new TextDecoder();
                const b64ToUint8 = (b64) => {
                    const bin = atob(b64);
                    const bytes = new Uint8Array(bin.length);
                    for (let i = 0; i < bin.length; i++) { bytes[i] = bin.charCodeAt(i); }
                    return bytes;
                };
                const iv = b64ToUint8(pkg.iv);
                const data = b64ToUint8(pkg.data);
                const keyMaterial = await crypto.subtle.importKey("raw", enc.encode(seed), {name: "PBKDF2"}, false, ["deriveKey"]);
                const key = await crypto.subtle.deriveKey(
                    { name: "PBKDF2", salt: enc.encode("salt-vfs"), iterations: 100000, hash: "SHA-256" },
                    keyMaterial, { name: "AES-GCM", length: 256 }, false, ["decrypt"]
                );
                const result = await crypto.subtle.decrypt({ name: "AES-GCM", iv: iv }, key, data);
                return dec.decode(result);
            }

            function render(filename) {
                if (!_VFS[filename]) return;
                const iframe = document.getElementById('vfs-iframe');
                const bin = atob(_VFS[filename]);
                const bytes = new Uint8Array(bin.length);
                for(let i=0; i<bin.length; i++) bytes[i] = bin.charCodeAt(i);
                const html = new TextDecoder().decode(bytes);
                const doc = iframe.contentDocument || iframe.contentWindow.document;
                doc.open();
                doc.write(html);
                doc.close();
                iframe.onload = () => {
                    const iDoc = iframe.contentDocument || iframe.contentWindow.document;
                    iDoc.querySelectorAll('a').forEach(link => {
                        link.onclick = (e) => {
                            const href = link.getAttribute('href');
                            if (!href) return;
                            const cleanHref = href.replace(/^\.\//, '');
                            if (_VFS[cleanHref]) { e.preventDefault(); render(cleanHref); }
                        };
                    });
                };
            }
